import axios from 'axios';
import React, { useContext, useEffect, useState } from 'react'
import { Link, useParams } from 'react-router-dom';
import AppContext from '../cart/Cart';

export default function Home({selectedCategory}) {
  const { data, isError, addToCart, refreshData } = useContext(AppContext);
  const [product, setProduct] = useState([]);
 const [isErrors, setIsError] = useState(false);
  const { id } = useParams();
  const[isDataFetched,setISDataFetched]=useState(false);
     useEffect(()=>{
    if(!isDataFetched){
      refreshData();
      setISDataFetched(true);
   }
},[refreshData,isDataFetched])

  useEffect(()=>{
   if(data && data.length>0){                                      //checking if data exists and has a item
    const fetchImageAndUpdatedProducts = async()=>{                 //defining fetch image and update products
    const updatedProducts=await Promise.all(                    // promise.all func used to handle multiple asynchronus function
    data.map(async(product)=>{    
      try{         
    const response = await axios.get(
      `http://localhost:8080/product/${product.id/image}`,
      {responseType:"blob"}
    );
     const imageUrl =URL.createObjectURL(response.data);
     return{...product,imageUrl};
    }catch(error){
      console.error("Error fetching image and product Id",product.id,error);
      return { ...product, imageUrl: "placeholder-image-url" };
    }
    })
    );
    setProduct(updatedProducts); 
    };
    f();
   }
  },[data])

  if (isErrors) {
    return <div className="alert alert-danger">There was an error fetching the products.</div>;
  }

  return (
    <div className="grid" style={{ display: "flex", flexWrap: "wrap", gap: "20px" }}>
      {product.length === 0 ? (
        <h2
          className="text-center"
          style={{
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            width: "100%",
          }}
        >
          No Products Available
        </h2>
      ) : (
        product.map((product) => {
          const { id, brand, name, price, productAvailable, imageUrl } = product;
  
          const cardStyle = {
            width: "300px",
            height: "300px",
            boxShadow: "0 4px 8px rgba(7, 56, 153, 0.1)",
            borderRadius: "10px",
            margin: "10px",
            display: "flex",
            flexDirection: "column",
            overflow: "hidden",
            backgroundColor: productAvailable ? "#fff" : "#ccc", // Background color based on availability
          };
  
          return (
            <div className="card mb-3" key={id} style={cardStyle}>
              <Link to={`/productById/${id}`} style={{ textDecoration: "none", color: "inherit" }}>
                <div>
                  <img
                    src={imageUrl}
                    alt={name}
                    style={{
                      width: "100%",
                      height: "180px",
                      objectFit: "cover",
                      padding: "5px",
                    }}
                  />
                  <div
                    className="buttons"
                    style={{
                      position: "absolute",
                      top: "25px",
                      left: "220px",
                      zIndex: "1",
                    }}
                  >
                    <div className="buttons-liked">
                      <i className="bi bi-heart"></i>
                    </div>
                  </div>
                  <div className="card-body" style={{ padding: "10px", display: "flex", flexDirection: "column", justifyContent: "space-between" }}>
                    <div>
                      <h5 className="card-title" style={{ margin: "0 0 10px 0" }}>
                        {name.toUpperCase()}
                      </h5>
                      <i className="card-brand" style={{ fontStyle: "italic" }}>
                        {"~ " + brand}
                      </i>
                    </div>
                    <div>
                      <h5 className="card-text" style={{ fontWeight: "600", margin: "5px 0" }}>
                        {"$" + price}
                      </h5>
                      <button
                        className="btn btn-primary"
                        style={{ width: "100%" }}
                        onClick={(e) => {
                          e.preventDefault();
                          // Add product to cart functionality
                        }}
                        disabled={!productAvailable}
                      >
                        {productAvailable ? "Add to Cart" : "Out of Stock"}
                      </button>
                    </div>
                  </div>
                </div>
              </Link>
            </div>
          );
        })
      )}
    </div>
  );
}
